I am writing some extensions to SharePoint's JSOM. I will limit to one example where I am implementing an import method on the SP.SOD object which wraps the SP.SOD loader song and dance and returns a promise. I would like to provide my implementation as a package with its own typings like so (stripped down to this single example):

``` ts
declare global {
    namespace SP {
        export interface SOD {
            import(sod: string | string[]): Promise<any>;
        }
    }
}
```
The above should extend upon the declaration that comes from `@types/sharepoint` and simply add the `import` method. The problem is the current declaration uses `class` everywhere and makes its near impossible to extend those classes with new static methods.

For example, if we change the following:
``` ts
declare namespace SP {
    class SOD {
        static execute(fileName: string, functionName: string, ...args: any[]): void;
        static executeFunc(fileName: string, typeName: string, fn: () => void): void;
        static executeOrDelayUntilEventNotified(func: (...args: any[]) => void, eventName: string): boolean;
        static executeOrDelayUntilScriptLoaded(func: () => void, depScriptFileName: string): boolean;
        static notifyScriptLoadedAndExecuteWaitingJobs(scriptFileName: string): void;
        static notifyEventAndExecuteWaitingJobs(eventName: string, args?: any[]): void;
        static registerSod(fileName: string, url: string): void;
        static registerSodDep(fileName: string, dependentFileName: string): void;
        static loadMultiple(keys: string[], fn: () => void, bSync?: boolean): void;
        static delayUntilEventNotified(func: (...args: any[]) => void, eventName: string): void;

        static get_prefetch(): boolean;
        static set_prefetch(value: boolean): void;

        static get_ribbonImagePrefetchEnabled(): boolean;
        static set_ribbonImagePrefetchEnabled(value: boolean): void;
    }
}
```

and remove the `class` declaration in favor of an `instance` declaration:
``` ts
declare namespace SP {
    interface SOD {
        execute(fileName: string, functionName: string, ...args: any[]): void;
        executeFunc(fileName: string, typeName: string, fn: () => void): void;
        executeOrDelayUntilEventNotified(func: (...args: any[]) => void, eventName: string): boolean;
        executeOrDelayUntilScriptLoaded(func: () => void, depScriptFileName: string): boolean;
        notifyScriptLoadedAndExecuteWaitingJobs(scriptFileName: string): void;
        notifyEventAndExecuteWaitingJobs(eventName: string, args?: any[]): void;
        registerSod(fileName: string, url: string): void;
        registerSodDep(fileName: string, dependentFileName: string): void;
        loadMultiple(keys: string[], fn: () => void, bSync?: boolean): void;
        delayUntilEventNotified(func: (...args: any[]) => void, eventName: string): void;

        get_prefetch(): boolean;
        set_prefetch(value: boolean): void;

        get_ribbonImagePrefetchEnabled(): boolean;
        set_ribbonImagePrefetchEnabled(value: boolean): void;
    }
    var SOD: SOD;
}
```

The object declaration now becomes extendable and my declaration from above works. This pull request is a start at converting the entire file to use `interface` instead of `class` where appropriate.

As I mentioned earlier, the main problem is when trying to add new 'static' methods to declared classes. I have been able to successfully extend declarations like the following without any changes to the current declarations:
```ts
declare global {
    namespace SP {
        export interface ClientRuntimeContext {
            /** A shorthand for context.executeQueryAsync except wrapped as a JS Promise object */
            executeQuery(): Promise<ClientRequestSucceededEventArgs>;
        }
    }
}
```

This works because I can extend the `ClientRuntimeContext` *type* with new methods this way. But the `import` method from above is trying to extend what is basically an already created *instance* of the SP.SOD object. Therefore all the changes I have made from line 2116 to the end were not really necessary for my purposes, but might be useful for others.

I've run these changes through several live tests and it seems to work drop-in. I bumped the version number since there could be other as yet undiscovered consequences.
